INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(2, 'Tallinn hakkab kõigile õpilastele 50 eurot õppetoetust maksma', 'Tallinna 2022. aasta eelarves on ette nähtud uus õppetoetus 50 eurot iga kooliõpilase kohta, summa makstakse välja õppeaasta alguses, ütles Tallinna linnapea Mihhail Kõlvart ETV+ saates \"Kohv+\".\r\n\r\n\"Järgmisest aastast maksame ka uut toetust – õppeaasta alguse toetust [summas] 50 eurot iga õpilase kohta, seda 1. septembriks. Praegu kehtib see ainult esimese klassi õpilastele, 320 eurot, järgmisest aastast saab iga õpilane lisaks sellele 50 eurot ning järgmisel perioodil loodame seda summat tõsta 100 euroni,\" ütles Kõlvart.\r\n\r\nKõlvart ütles ka, et Tallinnalt pensionäridele makstav toetus on järgmisel aastal 150 eurot ning linnavõimud loodavad selle summa järgmistel perioodidel tõsta 200 euroni.\r\n\r\nTallinna järgmise aasta eelarve seletuskirjas on öeldud, et toetust hakatakse maksma lisaks esimesse klassi astujatele ka neile, kes jätkavad põhi- või\r\nkeskhariduse omandamisega või õpib kutseõppe tasemeõppes, kuid mitte kauem kui 19-aastaseks saamiseni. \"Põhikooli esimesse klassi minejatele jääb kehtima senine toetusemäär 320 eurot ning ülejäänud sihtgrupile 50 eurot,\" seisab seletuskirjas.\r\n\r\nTallinna linnavalitsus kinnitas eelmisel nädalal pealinna järgmise aasta eelarve, mis ületab esimest korda miljardi euro piiri. Eelarve on kavas kinnitada linnavolikogus 21. detsembril. Eelarve esimene lugemine on volikogus sel neljapäeval.', , 1, 1);
INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(3, 'Narvas oli külma 24 kraadi', 'Riigi ilmateenistuse mõõtepunktidest oli möödunud ööl kõige külmem ilm Narvas, kus nii kella 2 ajal öösel kui ka kell 5 varahommikul langes õhutemperatuur –24 kraadini.\r\n\r\nKella 5 ajal oli Mustveel ja Väike-Maarjas külma 22 kraadi, Jõgeval ja Jõhvis 21 kraadi.\r\n\r\nVõrus oli õhutemperatuur kella 5 ajal –20, Türil -19, Kuressaares –18, Viljandis –17, Virtsus –17, Tallinnas –16, Pärnus –16, Tartus –15, Valgas –15, Otepääl –15, Haapsalus –14, Paldiski –13 kraadi. Kõige mahedam oli ilm Ruhnu saarel, kus külma oli 8 kraadi.\r\n\r\nIlmaprognoosi kohaselt tuleb eeloleval päeval muutliku pilvisusega ilm. Kohati sajab lund ja võib tuisata, saju võimalus on suurem põhjarannikul.\r\n\r\nPuhub kirde- ja idatuul 3–9, rannikul puhanguti 12–15 m/s. Õhutemperatuur on –14 kuni –20, kohati –23 kraadi. Rannikul mitmel pool –8 kuni –13 kraadi.\r\n\r\nEsmaspäeva varahommikul olid suuremad põhimaanteed valdavalt soolaniisked, kõrvalmaanteedel lumised.\r\n\r\nTeedel püsib libeduseoht. Keerulisemad võivad sõiduolud olla kõrvalmaanteedel, kohati võib olla tuisuvaalusid ja kinni tambitud jäiseid kohti. Liiklejatel tuleb arvestada, et kõrvalmaanteedel hooldustsükli aeg on pikem võrreldes suuremate teedega.', , 1, 1);
INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(4, 'Läti apteekrid said õiguse vaktsineerida inimesi Covid-19 vastu', 'Läti parlament võttis 25. novembril vastu epidemioloogilise ohutuse seaduse täiendused, mis näevad ka ette, et apteekrid võivad inimesi vaktsineerida koroonaviiruse vastu.\r\n\r\nTäiendused näevad ette, et apteekritele kehtestatakse vaktsineerimise suhtes kutsealase pädevuse nõuded. Iga apteek saab ise otsustada, kas pakkuda koroonaviiruse vastast vaktsineerimisteenust. \r\n\r\nMuudatuste eesmärk oli vähendada perearstide töökoormust. Eelnõu kohaselt võiksid apteekrid aidata parandada juurdepääsu usaldusväärsele ja teaduspõhisele teabele vaktsiinide kohta. Samuti muutub vaktsineerimine nii inimestele kättesaadavamaks. \r\n\r\nVarem nägi seadus ette, et inimesi võivad vaktsineerida ainult sertifitseeritud arstid.', , 2, 1);
INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(5, 'Läti politsei pidas kinni parlamendisaadiku', 'Läti politsei pidas esmaspäeval Tukumsi linnas kinni parlamendisaadik Aldis Gobzemsi.\r\n\r\nPole veel teada, kas rahvasaadik peeti kinni seoses haldus- või kriminaalmenetlusega. \r\n\r\n\"Parlamendiliikme saab vahi alla võtta vaid parlamendi nõusolekul,\" ütles parlamendi õigusbüroo juht Dina Meistere. \r\n\r\nSotsiaalmeediasse postitatud videotest on näha, et Gobzems viiakse politseiautosse. Enne autosse lükkamist osutas rahvasaadik vastupanu. Videos on näha, et Gobzemsil pandi käed raudu. \r\n\r\nGobzems saabus Tukumsisse, et avaldada meelt. Gobzemsi miiting oli plaanitud Lidli poe juurde. Vahistamine toimus üle tee kohalikus besniinijaamas. \r\n\r\nHulk inimesi väljendas ka häälekalt oma rahulolematust, et rahvasaadik vahistati. \r\n\r\nLäti politsei teatas, et esmaspäeval toimus Tukumsis koosolek, mis rikkus koosolekute ja rongkäikude seadust. \r\n\r\nPolitseinikud kutsusid ürituse korraldajat haldusrikkumist viivitamatult lõpetama, kuid Gobzems keeldus seda tegemast. Vastavalt seadusele peeti isik kinni ja toimetati selgituste andmiseks politseijaoskonda, teatas politsei. \r\n\r\nPolitsei sai samuti Tukumsis teateid, et rikutakse epidemioloogilise ohutuse reegleid, kuhu kogunes korraga üle 20 inimese.', , 5, 1);
INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(6, 'Esimesed mudilased said oma koroonavaktsiini kätte', 'Eesti alustas reedel 5-11-aastaste laste vaktsineerimist koroonaviiruse vastu. Lapsed saavad Pfizer-BioNTechi vaktsiini, võrreldes täiskasvanutega on lastele manustatava vaktsiini kogus väiksem.\r\n\r\nPerearstikeskuses olnud lapsevanemad ootasid laste vaktsineerimise võimalust ning kõrvaltoimeid ei karda.\r\n\r\n\"Meil on juba vanem laps ka, kes on vaktsineeritud ja mõtlesime, et kui nüüd tuleb see võimalus, siis kindlasti tahaks ka nooremale teha,\" kommenteeris ema Monika.\r\n\r\n\"Kõrvaltoimeid ei karda sellepärast, et kui nad ka tulevad, siis Covid ise on ju poole hullem või ma ei saa öelda poole hullem, vaid kohe palju mitmeid kordi hullem ja kõrvaltoimed mööduvad iseenesest,\" põhjendas perearst Karmen Joller.\r\n\r\nEsmalt hakkavad 5-11-aastaseid lapsi vaktsineerima eelkõige perearstid. Võimalus on aga olemas ka suuremates haiglates.\r\n\r\n\"Siin pööratakse nüüd tähelepanu sellele, et oleks kindlasti arsti isiklik lähenemine, et lapsevanem saaks küsida kõiki oma küsimusi perearstilt vahetult,\" kommenteeris terviseameti peadirektori kt Mari-Anne Härma. \"See on hetkel oluline, et luua võimalikult selline turvaline, usalduslik keskkond, kuhu lapsevanemad oma lastega saaksid tulla.\"\r\n\r\nLapsed saavad Pfizer-BioNTechi vaktsiini, kuid väiksemas koguses.\r\n\r\n\"See maht on väiksem kui täiskasvanud inimesele, aga doose on ikka kaks tükki,\" täpsustas Härma. \"Nii et esimene tehakse ära ja siis kuue nädala pärast tuleb\r\nkordusdoos teha ja siis loetakse vaktsineerimiskuur lõpetatuks.\"\r\n\r\nPerearst Reet Laidoja sõnul on Tallinna Linnamõisa perearstikeskus laste vaktsineerimiseks valmis ning vabu aegu veel jagub.\r\n\r\n\"Praeguseks on järgmiseks nädalaks meil ajad avatud ja ka digiregistratuuris on vanemad meid juba üles leidnud. Me vaktsineerime, nii et huvi ikka vaikselt on,\" kinnitas Laidoja.\r\n\r\nHärma sõnas, et lastel on vaktsiini kõrvaltoimeid võrreldes täiskasvanutega vähem.\r\n\r\n\"Praegu see hinnang on, et kuskil alla viie protsendi juhtudest võib tekkida see ja see kõrvalreaktsioon, aga üldiselt lastel läheb see natuke kergemini kui täiskasvanutel. Selle vaktsiini mõju on praegu juba näha, et see on väga tõhus ja väga hea,\" kinnitas Härma.\r\n\r\n\"Raskeid kõrvaltoimeid ei olegi olnud siiamaani ja vaktsineeritud on tänaseks umbes viis miljonit last vanuses 5-11, maailmas. Mina küll väga julgelt lasin\r\noma lastele selle süsti teha,\" ütles Joller.', , 1, 1);

